prompt Creating DEPARTMENT...
create table DEPARTMENT
(
  departid    NUMBER(5) not null,
  departname  VARCHAR2(35) not null,
  budget      INTEGER,
  maxcapacity INTEGER,
  currentsize INTEGER
)
tablespace SYSTEM
  pctfree 10
  pctused 40
  initrans 1
  maxtrans 255
  storage
  (
    initial 64K
    next 1M
    minextents 1
    maxextents unlimited
  );
alter table DEPARTMENT
  add constraint PK_DEPARTMENT primary key (DEPARTID)
  using index 
  tablespace SYSTEM
  pctfree 10
  initrans 2
  maxtrans 255
  storage
  (
    initial 64K
    next 1M
    minextents 1
    maxextents unlimited
  );
grant select, insert, update, delete, references, alter, index, debug, read on DEPARTMENT to PUBLIC;

